selector_to_html = {"a[href=\"#a0er1\"]": "<div class=\"proof eksempel admonition\" id=\"a0er1\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 1.15 </span> (<span class=\"math notranslate nohighlight\">\\(a^0 = 1\\)</span> altid)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>En regneregel mere kunne v\u00e6re <span class=\"math notranslate nohighlight\">\\(a^0=1\\)</span>, men det er egentlig blot et resultat af Regneregel <span class=\"math notranslate nohighlight\">\\(\\eqref{p4}\\)</span>, hvor eksponenterne <span class=\"math notranslate nohighlight\">\\(p=q\\)</span> er det samme tal. Antag, at <span class=\"math notranslate nohighlight\">\\(p=q\\)</span>, da har vi</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\frac{a^p}{a^q} = \\frac{a^p}{a^p} = \\frac{\\overbrace{a\\cdot \\cancel{a} \\cdots \\cancel{a}}^{p\\ \\text{gange}}}{\\underbrace{a \\cdot \\cancel{a} \\cdots \\cancel{a}}_{p\\ \\text{gange}}} = \\frac{a}{a} = 1 \\]</div>\n<p>Vi kan allerede se, at det giver 1 ved f\u00f8rste lighedstegn, da vi kommer til at f\u00e5 det samme tal <span class=\"math notranslate nohighlight\">\\(a^p\\)</span> i t\u00e6lleren og n\u00e6vneren. Det s\u00e5 vi i <a class=\"reference internal\" href=\"broeker.html#broeker\"><span class=\"std std-numref\">Kapitel 1.6</span></a>. Men her brugte vi jo egentlig bare definitionen af en potens. Bruger vi Regneregel <span class=\"math notranslate nohighlight\">\\(\\eqref{p4}\\)</span> i dette tilf\u00e6lde, s\u00e5 f\u00e5r vi</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\frac{a^p}{a^q} = \\frac{a^p}{a^p} = a^{p-p} = a^0.\\]</div>\n<p>Sammens\u00e6tter vi nu vores to resultater, s\u00e5 har vi at</p>\n<div class=\"math notranslate nohighlight\">\n\\[    a^0 = 1 \\tag{P6}\\label{p6}\n    \n\\]</div>\n</section>\n</div>", "a[href=\"../Maengdeteori/talmaengder.html#ligeoguligetal\"]": "<div class=\"proof definition admonition\" id=\"ligeoguligetal\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Definition 2.1 </span> (Lige og ulige tal)</p>\n<section class=\"definition-content\" id=\"proof-content\">\n<p>Et tal siges at v\u00e6re <em>lige</em>, hvis det kan skrives p\u00e5 formen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    2\\cdot n\\]</div>\n<p>og et tal siges at v\u00e6re <em>ulige</em>, hvis det kan skrives p\u00e5 formen</p>\n<div class=\"math notranslate nohighlight\">\n\\[    2 \\cdot n - 1,\\]</div>\n<p>hvor <span class=\"math notranslate nohighlight\">\\(n\\)</span> er et eller andet heltal.</p>\n</section>\n</div>", "a[href=\"#potenser\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.7. </span>Potenser<a class=\"headerlink\" href=\"#potenser\" title=\"Permalink til denne overskrift\">#</a></h1><p>Potenser er ogs\u00e5 tal, som du l\u00e6rte om i folkeskolen. Potenser er blot en m\u00e5de at forkorte regner\u00e6kke hvor samme tal ganges sammen flere gange.</p>", "a[href=\"broeker.html#broeker\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.6. </span>Br\u00f8ker<a class=\"headerlink\" href=\"#broker\" title=\"Permalink til denne overskrift\">#</a></h1><p>Som du nok husker tilbage fra folkeskolen, s\u00e5 er br\u00f8ker en anden m\u00e5de at skrive et divisionsstykke p\u00e5. Men faktisk, s\u00e5 er selve br\u00f8ken en form for et tal. Tal, der kan skrives som en br\u00f8k, kaldes et rationale tal og det kan du l\u00e6se mere om i <a class=\"reference internal\" href=\"../Maengdeteori/maengdeteori.html#maengdeteori-i\"><span class=\"std std-numref\">Kapitel 2</span></a>. Vi kommer til at bruge begge m\u00e5der at tolke en br\u00f8k p\u00e5. Som oftest vil vi skrive divisionsstykker som en br\u00f8k, og ligeledes vil vi nogen gange skrive visse decimaltal som br\u00f8ker.</p>", "a[href=\"tallene.html#negativetal\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.1.2. </span>Negative tal<a class=\"headerlink\" href=\"#negative-tal\" title=\"Permalink til denne overskrift\">#</a></h2><p>De negative tal skal repr\u00e6sentere id\u00e9en om modsatte tal. Hvis du f\u00e5r penge ind, s\u00e5 er det modsatte at give penge v\u00e6k. Den pengestr\u00f8m kan beskrives i to modsatte bev\u00e6gelser. Hvis du f\u00e5r penge ind, s\u00e5 bliver din bankkonto st\u00f8rre, og hvis du giver penge v\u00e6k, s\u00e5 bliver din bankkonto mindre. Denne str\u00f8m kan nedskrives matematisk med brugen af negative tal, og netop derfor er de s\u00e5 anvendelige. De finder sig faktisk ogs\u00e5 anvendelige p\u00e5 temperaturskalaerne.</p><p>Lad os vende tilbage til begrebet <em>modsatte tal</em>. Det modsatte tal af <span class=\"math notranslate nohighlight\">\\(4\\)</span> er <span class=\"math notranslate nohighlight\">\\(-4\\)</span>, og det ved vi som en konsekvens af nulreglen. Hvad er det modsatte tal af <span class=\"math notranslate nohighlight\">\\(-2\\)</span>? Igen kan vi bruge nulreglen til at vise, at det modsatte tal af <span class=\"math notranslate nohighlight\">\\(-2\\)</span> er <span class=\"math notranslate nohighlight\">\\(2\\)</span>. Derfor har vi f\u00f8lgende definition af et modsat tal:</p>", "a[href=\"#opgaver\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.7.2. </span>Opgaver<a class=\"headerlink\" href=\"#opgaver\" title=\"Permalink til denne overskrift\">#</a></h2>", "a[href=\"#ti-er-potens\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.7.1. </span>Ti\u2019er potens<a class=\"headerlink\" href=\"#ti-er-potens\" title=\"Permalink til denne overskrift\">#</a></h2><p>N\u00e5r vi arbejder med meget store eller meget sm\u00e5 tal, s\u00e5 kan det v\u00e6re en id\u00e9 at have en anden m\u00e5de at angive dem p\u00e5. Hvis vi for eksempel arbejdede med en opgave, hvor vi skulle regne med Jordens masse, der er</p>", "a[href=\"#p7\"]": "<div class=\"proof eksempel admonition\" id=\"p7\">\n<p class=\"admonition-title\"><span class=\"caption-number\">Eksempel 1.16 </span> (<span class=\"math notranslate nohighlight\">\\(a^{-n} = \\frac{1}{a^n}\\)</span>)</p>\n<section class=\"eksempel-content\" id=\"proof-content\">\n<p>Vi kan ogs\u00e5 have eksponenter, der er negative. Ogs\u00e5 denne regneregel er et resultat af <span class=\"math notranslate nohighlight\">\\(\\eqref{p4}\\)</span>, hvor eksponenten for potensen i t\u00e6lleren er 0. Fra <a class=\"reference internal\" href=\"#a0er1\">Eksempel 1.15</a> ved vi, at t\u00e6lleren vil v\u00e6re lig med 1. Reglen falder derfor ret direkte ud:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\frac{a^0}{a^n} = \\frac{1}{a^n}\\]</div>\n<p>Men ogs\u00e5 fra <span class=\"math notranslate nohighlight\">\\(\\eqref{p4}\\)</span>:</p>\n<div class=\"math notranslate nohighlight\">\n\\[    \\frac{a^0}{a^n} = a^{0-n} = a^{-n}.\\]</div>\n<p>Alts\u00e5 har vi</p>\n<div class=\"math notranslate nohighlight\">\n\\[    a^{-n} = \\frac{1}{a^n} \\tag{P7}\\label{p7}\n    \n\\]</div>\n</section>\n</div>", "a[href=\"#si-praefikser\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">1.7.1.1. </span>SI-pr\u00e6fikser<a class=\"headerlink\" href=\"#si-praefikser\" title=\"Permalink til denne overskrift\">#</a></h3><p>En s\u00e6rlig anvendelse af ti\u2019er potenser kan findes ved angivelser af m\u00e5leenheder. Vi arbejder som oftest med enheder fra SI-systemet, der er en samling af syv grundl\u00e6ggende SI-enheder:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
